                                <input type="text" name="calories"/>
                                <p>Ingredients</p>
                                <input type="text" name="ingredients"/>
                                <p>Instructions</p>
                                <input type="text" name="instructions"/>
                                <br />
                                <br />
                                <input type="submit"/>
                            </form>
                        </div>
                    </div>
                </body>
            </html>
        );
    };
};

